//import logo from './logo.svg';
import './App.css';
import NavBar from './components/navbar/NavBar';
import Home from './components/pages/Home';
import { Routes ,Route } from 'react-router-dom';

function App() {
  return (
    <div >
      <Route>
        <NavBar />
        <Routes>
          <Route path="/" element={<Home/>} />

        </Routes>
      </Route>


    </div>
  );
}

export default App;
